/* comando para instalar extenções*/
create extension if not exists pgcrypto;
create extension if not exists postgis;

/* comando de criação das tabelas*/

/* tabela para o cadastro e login do cidadão*/
create table cadastrocidadao (
    id serial not null,
    email varchar(50) null,
    senha text null,
    nome varchar(50) null,
    cpf varchar(11) null,
    rg varchar(9) null,
    data_nascimento varchar(20) null,
    sexo varchar(1) null,
    telefone varchar(11) null,
    constraint pk_cadastrocidadao primary key (id)
);


/* tabela para a area de investimento */
create table areainvestimento (
    id serial not null,
    descricao varchar(50) null,
    notaExplicativa varchar(150)  null,
    constraint pk_areainvestimento primary key (id)
);

/* tabela para instituição */
create table instituicao (
    id serial not null,
    descricao varchar(50) null,
    cnpj varchar(14) null,
    notaExplicativa varchar(150) null,
    constraint pk_instituicao primary key (id)
);

/* tabela para a cidade*/
create table cidade(
    id serial not null,
    geom geometry  null,
    descricao varchar(50) null,
    constraint pk_cidade primary key (id)
);


/* tabela para as regioes */
create table regiao(
    id serial not null,
    geom geometry null,
    descricao varchar(50) null,
    constraint pk_regiao primary key (id)
);

/* tabela para o formulario*/
create table formulario(
    id serial not null,
    id_cidade int  null,
    id_regiao int  null,
    id_areainvestimento int  null,
    id_instituicao int  null,
    id_cadastrocidadao int  null,
    sugestao varchar(150) null,
    constraint pk_formulario primary key (id),
    constraint fk_formulario_cidade foreign key (id_cidade) references cidade(id),
    constraint fk_formulario_regiao foreign key (id_regiao) references regiao(id),
    constraint fk_formulario_areainvestimento foreign key (id_areainvestimento) references areainvestimento(id),
    constraint fk_formulario_instituicao foreign key (id_instituicao) references instituicao(id),
    constraint fk_formulario_cadastrocidadao foreign key (id_cadastrocidadao) references cadastrocidadao(id)
);

/* index para as fk da tabela acima*/
create index if not exists formulario_cidade_ifk on formulario using btree (id_cidade);
create index if not exists formulario_regiao_ifk on formulario using btree (id_regiao);
create index if not exists formulario_areainvestimento_ifk on formulario using btree (id_areainvestimento);
create index if not exists formulario_instituicao_ifk on formulario using btree (id_instituicao);
create index if not exists formulario_cadastrocidadao_ifk on formulario using btree (id_cadastrocidadao);

/* tabela para o cadastro de foto*/
create table foto(
    id serial not null,
    id_formulario int null,
    foto bytea null,
    constraint pk_foto primary key (id),
    constraint fk_foto_formulario foreign key (id_formulario) references formulario(id)
);

/* index para a fk da tabela acima*/
create index if not exists foto_formulario_ifk on foto using btree (id_formulario);





